           gender : 'female'
       };   
       async createUser(){        
           const userRes=  await request
           .post('users')
           .set('Authorization',`Bearer ${TOKEN}`)
           .send(this.userData)

           const userId =  await userRes.body.data.id;
           console.log("HELLO>>>",userId)
            return userId;
    }}
    module.exports = new CreateRandomUser();

