const supertest =require('supertest');
const { expect } = require('chai');
const request = supertest('https://api.nylservices.net/games/');
const apikey = '3httNHLjxN6KluYfd4DuH188SwgqgMDN3DyE2PVs';
describe('NYL Games', function ()  {
    it.only('GET /megamillions/draws', async () => {
        try{
        const res = await request
            .get(`megamillions/draws`)
            .set('x-api-key',`${apikey}`)

            console.log("Output here:::")
            // console.log(res.body.data.draws[1].results[0]["secondary"])

            // console.log(res.body.data.draws[1].drawNumber)
            console.log(res.body.data.draws.length)
            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('12');
            expect(res.body.data.draws).to.not.be.null;

        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /pick10/draws', async () => {
        try{
        const res = await request
            .get(`pick10/draws`)
            .set('x-api-key',`${apikey}`)
            console.log("Output here:::")
            console.log(res.body.data.draws)
            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('27');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /quickdraw/draws', async () => {
        try{
        const res = await request
            .get(`quickdraw/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('22');
            console.log(res.statusCode)
            console.log(res.body.data)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /powerball/draws', async () => {
        try{
        const res = await request
            .get(`powerball/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('15');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /lotto/draws', async () => {
        try{
        const res = await request
            .get(`lotto/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('8');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /cash4life/draws', async () => {
        try{
        const res = await request
            .get(`cash4life/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('13');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /take5/draws', async () => {
        try{
        const res = await request
            .get(`take5/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('10');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /numbers/draws', async () => {
        try{
        const res = await request
            .get(`numbers/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('9');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
    it('GET /win4/draws', async () => {
        try{
        const res = await request
            .get(`win4/draws`)
            .set('x-api-key',`${apikey}`)

            expect(res.body.data.status).to.be.eq('SUCCESS');
            expect(res.body.data.statusCode).to.be.eq(200);
            expect(res.body.data.gameId).to.be.eq('14');
            console.log(res.statusCode)
        } catch(err) {
            throw ("Error...",err)
        }
    });
   });

