const supertest =require('supertest');
const { expect } = require('chai');
const request = supertest('https://gorest.co.in/public-api/');
const TOKEN = '2786dcaf18c1a06b0fdaaa02de64b87f9f4db0f71cf1f0e631eaab72ff5939ab';
// describe.skip('Users', () => { //to .skip the tests
describe('Users', () => { //to .skip the tests
    it('GET all users with /users', async () => {
        await request.get(`users?access-token=${TOKEN}`).then((res)=>{ 
        expect(res.statusCode).to.be.equal(200);
        expect(res.body.data).to.not.be.empty;
        });
    });
    it('Get single user /users/:id', async () => {
        await request.get(`users/3968322?access-token=${TOKEN}`).then((res)=>{
            expect(res.body).to.not.be.empty;
            expect(res.statusCode).to.be.equal(200);
            expect(res.body.data.id).to.be.equal(3968322);
        });
    });
    it('Get users using query parameters - from page-4 who are active and female', async () => {
        const req = await request.get(`users?access-token=${TOKEN}&page=4&gender=female&status=active`)
        req.body.data.forEach((data)=>
        {
            // console.log(data)
            expect(data.gender).to.be.eq("female")
            expect(data.status).to.be.eq("active")
        });
    });
    it('POST /users', async () => {
        const data={
            email : `test-${Math.floor(Math.random()*1000)}@gmail.com`,
            name : 'ABC1',
            status : 'active',
            gender : 'male'
        }
        const res=await request
        .post('users')
        .set('Authorization',`Bearer ${TOKEN}`)
        .send(data)

        expect(res.body.data).to.deep.include(data)
        expect(res.body.code).to.be.equal(201)
    });
    it('PUT /users/:id', async () => {
        const data={
            name : `ABC1`,
            status : 'active',
            gender : 'male'
        }
        // -${Math.floor(Math.random()*1000)}`,
        const res = await request
                        .put('users/3968322')
                        .set('Authorization',`Bearer ${TOKEN}`)
                        .send(data)
        expect(res.body.data).to.deep.include(data);
    });

    it('DELETE /users/:id', async () => {
        const res = await request
                        .delete('users/3962345')
                        .set('Authorization',`Bearer ${TOKEN}`)
        console.log(res.body.data)
        expect(res.body.data).to.be.eq(null)
    });
});

